window.mustNotInclude = {
    "yaw": 0,
    "health": 100,
    "maxHealth": 100,
    "damage": 10,
    "height": 32,
    "width": 32,
    "collisionRadius": 70,
    "entityClass": "Prop",
    "dead": 0,
    "timeDead": 0,
    "slowed": 0,
    "stunned": 0,
    "hits": [],
    "interpolatedYaw": 0
}

window.toInclude = (entity) => {
    let data = {};
    for (let i in window.mustNotInclude) {
        entity[i] = window.mustNotInclude[i];
    }
    return entity;
}

window.getRealPosOfIndex = (index) => {
    return {
        x: ((((index * 100).toFixed(2) - "") % 5000000) | 0) / 100,
        y: (index / 50000 | 0) / 100
    }
}

window.decodeSpotJSON = (json) => {
    let arr = JSON.parse(json);
    let obj = {};
    for (let i = 0; i < arr.length; i++) {
        arr[i] && (obj[i + 1] = {
            model: window.detectModelByUid(i + 1),
            position: window.getRealPosOfIndex(arr[i]),
            uid: i + 1
        });
    }
    return obj;
}

window.detectModelByUid = (uid) => {
    if (0 < uid && uid <= 400) {
        return "Tree";
    }
    if (400 < uid && uid <= 800) {
        return "Stone";
    }
    if (800 < uid && uid <= 825) {
        return "NeutralCamp";
    }
}
